void nn_linear(const float* weights, const float* biases, const float* input, int in_features, int out_features, float* output) {
    for (int i = 0; i < out_features; ++i) {
        float neuron = biases[i];
        for (int j = 0; j < in_features; ++j) {
            neuron += input[j] * weights[i * in_features + j];
        }
        output[i] = neuron;
    }
}

void nn_relu(float* input, int size) {
    for (int i = 0; i < size; ++i) {
        input[i] = fmaxf(0, input[i]);
    }
}

void nn_tanh(float* input, int size) {
    for (int i = 0; i < size; ++i) {
        input[i] = tanh(input[i]);
    }
}

void nn_forward(const float* input, float* output) {
    float fc1_output[120];
    nn_linear(weights_fc1, biases_fc1, input, 24, 120, fc1_output);
    nn_relu(fc1_output, 120);
    float fc2_output[120];
    nn_linear(weights_fc2, biases_fc2, fc1_output, 120, 120, fc2_output);
    nn_relu(fc2_output, 120);
    float fc3_output[120];
    nn_linear(weights_fc3, biases_fc3, fc2_output, 120, 120, fc3_output);
    nn_relu(fc3_output, 120);
    nn_linear(weights_fc4, biases_fc4, fc3_output, 120, 4, output);
}
